import React, {useState,useEffect} from "react"

export const Hello = function(){
const [state,setState] = useState([])
const [weather,setWeather] = useState({
"coord": {
"lon": -0.1257,
"lat": 51.5085
},
"weather": [
{
"id": 801,
"main": "Clouds",
"description": "few clouds",
"icon": "02d"
}
],
"base": "stations",
"main": {
"temp": 19.98,
"feels_like": 19.99,
"temp_min": 17.88,
"temp_max": 21.25,
"pressure": 1009,
"humidity": 75
},
"visibility": 10000,
"wind": {
"speed": 3.6,
"deg": 240
},
"clouds": {
"all": 20
},
"dt": 1627381113,
"sys": {
"type": 1,
"id": 1414,
"country": "GB",
"sunrise": 1627359414,
"sunset": 1627415813
},
"timezone": 3600,
"id": 2643743,
"name": "London",
"cod": 200
})
useEffect(function(){
  fetch("/api/").then(res => {
    if(res.ok){
      return res.json()
    }
  }).then(jsonResponse => setState(jsonResponse))
},[])
fetch(state.hello)
  .then(response => response.json())
  .then(data => setWeather(data));


return (<div>{weather.sys.country}</div>)
}
